package server

import (
	"fmt"
	"net/smtp"
	"strings"
)

const (
	// 邮件服务器地址
	smtpMailHost = "smtp.126.com"
	// 端口
	smtpMailPort = "25"
	// 发送邮件用户账号
	smtpMailUser = "xxxx@126.com"
	// 授权密码
	smtpMailPwd = ""
)

func SenMail(birthday Birthday) {
	auth := smtp.PlainAuth("", smtpMailUser, smtpMailPwd, smtpMailHost)
	to := strings.Split(birthday.SendEmail, ";")
	text := textBody(birthday)
	buffix := strings.Join([]string{"From: BirthdayReminder", "Subject: 生日提醒",
		"Content-Type: text/html; charset=UTF-8\r\n", text}, "\r\n")
	// 554 DT:SPM 发送的邮件内容包含了未被许可的信息，或被系统识别为垃圾邮件。请检查是否有用户发送病毒或者垃圾邮件；
	// 对多个发送人拆成一个一个发送
	for _, tou := range to {
		msg := "To: " + tou + "\r\n" + buffix
		err := smtp.SendMail(fmt.Sprintf("%s:%s", smtpMailHost, smtpMailPort), auth, smtpMailUser, []string{tou}, []byte(msg))
		if err != nil {
			fmt.Printf("send "+birthday.Name+" reminder to %s fail %v\n", tou, err)
		} else {
			fmt.Printf("send "+birthday.Name+" reminder to %s success\n", tou)
		}
	}
}

func textBody(birthday Birthday) string {
	html := `
	<table width="640px" height="457px" border="0" cellspacing="0" cellpadding="0" align="center">
	<tr>
	  <td style="background:url(data:image/jpg;base64,);">
		<div style="text-align:center">
		  <h1>祝` + birthday.Name + `生日快乐</h1>
		  <p>日期:` + birthday.TimeText + `</p>
	  </div>
	  </td>
	</tr>
  </table>
	`
	return html
}
